// Import Link from react-router-dom
import React from 'react';
import styles from './Sidebar.module.css'; // Assuming you have a CSS module for styling
import Button from '../../ui/button/Button'; // Adjust the path according to the actual file structure

const Sidebar = () => {
    return (

        <aside className={styles.sidebar} style={{
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
        }}>
            <Button path="/">Home</Button>
            <Button path="/about">About</Button>
            <Button path="/settings">Settings</Button>
        </aside>
    );
};

export default Sidebar;
